import React from 'react';
import { Navbar } from 'react-bootstrap';
import NavbarCategorias from '../NavbarCategorias/NavbarCategorias';

function NavHeader({borderNavbar, categoriesList, categoriesCallback}) {
    return (
        //'blur border-bottom-transition ' + (borderNavbar ? 'border-bottom-active' : '')
        <Navbar collapseOnSelect expand='lg' sticky='top' className={`blur border-bottom-transition ${borderNavbar ? 'border-bottom-active' : ''}`}>
            <div className='container-fluid'>
                <a className="navbar-brand text-secondary text-hover-color" href="#"><h1>R-IMAGE</h1></a>

                <Navbar.Toggle aria-controls='responsive-navbar-nav' />

                <Navbar.Collapse className='justify-content-end'>
                    <h4 className='text-center text-secondary d-lg-none'>CATEGORIES</h4>
                    <NavbarCategorias categoriesList={categoriesList} categoriesCallback={categoriesCallback} />
                </Navbar.Collapse>

                <Navbar.Collapse className='justify-content-end'>
                    <a className="nav-link active text-secondary text-center text-hover-color" aria-current="page" href="./pages/contacto.html"><h4>CONTACT</h4></a>
                </Navbar.Collapse>
            </div>
        </Navbar>
    );
}

export default NavHeader;
